% k1=0.5/180*pi;
% k2=-0.5;
% k3=0.07;
% k4=-1.39;


% k1min=0;
% k1max=1;
% k2min=-1;
% k2max=1;
% k3min=0;
% k3max=1;
% k4min=-5;
% k4max=0;

%初始化个体
% x=randi([0,1],N,D);
x=ones(N,D);
x(:,1)=0.5/180*pi;
x(:,2)=-0.5;
x(:,3)=0.07;
x(:,4)=-1.39;


v=rand(N,D)*(Vmax-Vmin)+Vmin;
%初始化个体最优位置和最优值
p=x;
pbest=ones(N,1);
for i=1:N
    
    k1=x(i,1);
    k2=x(i,2);
    k3=x(i,3);
    k4=x(i,4);
    model='bicycle';
    pbest(i)=PSO_road(x(i,1),x(i,2),x(i,3),x(i,4),0,model);
end
%初始化全局最优位置和最优值
g=ones(1,D);
gbest=inf;
for i=1:N
    if (pbest(i)<gbest)
        g=p(i,:);
        gbest=pbest(i);
    end
end
gb=ones(1,T);
%按照公式依次迭代直到满足精度或者迭代次数
for i=1:T
    for j=1:N
        %更新个体最优位置和最优值
        k1=x(j,1);
        k2=x(j,2);
        k3=x(j,3);
        k4=x(j,4);
        model='bicycle';
        t_PSO=PSO_road(x(j,1),x(j,2),x(j,3),x(j,4),i,model);
        if (t_PSO<pbest(j))
            p(j,:)=x(j,:);
            pbest(j)=t_PSO;
        end
           %更新全局最优位置和最优值
        if (pbest(j)<gbest)
            g=p(j,:);
            gbest=pbest(j);
        end
        v(j,:)=w*v(j,:)+c1*rand*(p(j,:)-x(j,:))+c2*rand*(g-x(j,:));
        x(j,:)=x(j,:)+v(j,:);
        %边界条件处理
        for ii=1:D
            % k1min=0;
% k1max=1;
% k2min=-1;
% k2max=1;
% k3min=0;
% k3max=1;
% k4min=-5;
% k4max=0;
            if(ii==1)
                Xmin=0;
                Xmax=1;
            elseif (ii==2)
                Xmin=-1;
                Xmax=0;
            elseif  (ii==3)
                Xmin=0;
                Xmax=1;     
            else
                Xmin=-5;
                Xmax=0;  
            end
            
            if (v(j,ii)<Vmin)||(v(j,ii)>Vmax)
                v(j,ii)=rand*(Vmax-Vmin)+Vmin;
            end
            if (x(j,ii)<Xmin)||(x(j,ii)>Xmax)
                x(j,ii)=rand*(Xmax-Xmin)+Xmin;
            end
        end
    end
    %记录全局最优值
    gb(i)=gbest;
end
g;                         %最优个体
gb(end);                   %最优值
figure
plot(gb)
